message:
Add a bonus to MCTS results depending on the game length;
normalize the length and score bonusses by their mean and
standard deviation.

No longer disable menu icons (was ignored by Ubunut Unity anyway);
instead, provide optimized 16x16 versions of the icons, so that they
don't look blurry in the menu.

Handle plurals in translations using the tr("%n", "", n) idiom;
remove translations in code that had become dead after the recent change
of the string representation of move variations.
